    false,nt"url": null,nt"notes": "NODC Accession 0115153 includes chemical,
    meteorological, physical and underway - surface data collected from AURORA AUSTRALIS
    in the Great Australian Bight, Indian Ocean, South Pacific Ocean and Tasman Sea
    from 1992-10-19 to 2001-12-12 and retrieved during cruise 09AR19921019. These data
    include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC
    PRESSURE, CARBON DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide,
    SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these data
    include Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower head
    chamber equilibrator for autonomous carbon dioxide (CO2) measurement and thermosalinographs.
    These data were collected by Bronte Tilbrook of Commonwealth Scientific and Industrial
    Research Organization as part of the VOS_Aurora_Australis_Lines_1992-2001 data set.nnThe
    Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
    Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
    have been outfitting research ships and commercial vessels with automated CO2 sampling
    equipment to analyze the carbon exchange between the ocean and atmosphere.",nt"owner_org":
